class EmailAuthBackend(object):
    """
    Consolidated authentication backend that supports both Django User and Provider models.
    """

    def _get_user(self, username, model_type):
        """
        Retrieve a user instance based on the provided username and model type.

        :param username: The email address used for authentication.
        :param model_type: 'django' for django_User, 'provider' for Provider.
        :return: User instance or None if not found.
        """
        if model_type == 'django':
            try:
                return django_User.objects.get(email=username)
            except django_User.DoesNotExist:
                return None
        elif model_type == 'provider':
            return Provider.objects.filter(idUser__mail__contains=username).first()
        return None

    def authenticate(self, username=None, password=None, model_type='django'):
        """
        Authenticate a user against the specified model type.

        :param username: Email address.
        :param password: Plain text password.
        :param model_type: 'django' or 'provider'.
        :return: Authenticated user instance or None.
        """
        user = self._get_user(username, model_type)
        if user and check_password(password, user.password):
            return user
        return None

    # Backwards‑compatibility wrappers -------------------------------------------------
    def authenticate2(self, username=None, password=None):
        """Legacy alias for provider authentication."""
        return self.authenticate(username, password, model_type='provider')

    def auth_email(self, username=None):
        """Legacy alias to retrieve a Provider by email."""
        return self._get_user(username, model_type='provider')

    def auth_email2(self, username=None):
        """Legacy alias to retrieve a Django User by email."""
        return self._get_user(username, model_type='django')


