import os, shlex, shutil, traceback, errno, sys, stat
from waflib import Utils, Configure, Logs, Options, ConfigSet, Context, Errors, Build, Node

build_dir_override = None
no_climb_commands = ['configure']
default_cmd = "build"

# --------------------------------------------------------------------------- #
# Helper functions for waf_entry_point
# --------------------------------------------------------------------------- #

def _check_version(version):
    """Verify that the script and library versions match."""
    if Context.WAFVERSION != version:
        Logs.error(
            'Waf script %r and library %r do not match (directory %r)'
            % (version, Context.WAFVERSION, Context.waf_dir)
        )
        sys.exit(1)

def _handle_version_flag(current_directory):
    """Handle the '--version' command line flag."""
    Context.run_dir = current_directory
    ctx = Context.create_context('options')
    ctx.curdir = current_directory
    ctx.parse_args()
    sys.exit(0)

def _determine_no_climb():
    """Determine whether we should stop climbing up the directory tree."""
    no_climb = os.environ.get('NOCLIMB', None)
    if not no_climb:
        for k in no_climb_commands:
            if k in sys.argv:
                no_climb = True
                break
    return no_climb

def _load_lockfile(dir_path):
    """Try to load a lockfile from the given directory."""
    env = ConfigSet.ConfigSet()
    try:
        env.load(os.path.join(dir_path, Options.lockfile))
        ino = os.stat(dir_path)[stat.ST_INO]
    except Exception:
        return None
    else:
        # Verify that the lockfile refers to the same filesystem
        for x in [env.run_dir, env.top_dir, env.out_dir]:
            if Utils.is_win32:
                if dir_path == x:
                    return env
            else:
                try:
                    ino2 = os.stat(x)[stat.ST_INO]
                except OSError:
                    continue
                else:
                    if ino == ino2:
                        return env
        Logs.warn('invalid lock file in %s' % dir_path)
        return None

def _find_run_dir(start_dir, no_climb):
    """Traverse up the directory tree to find the run directory."""
    cur = start_dir
    while cur:
        lst = os.listdir(cur)
        if Options.lockfile in lst:
            env = _load_lockfile(cur)
            if env:
                Context.run_dir = env.run_dir
                Context.top_dir = env.top_dir
                Context.out_dir = env.out_dir
                return
        if not Context.run_dir:
            if Context.WSCRIPT_FILE in lst:
                Context.run_dir = cur
        next_dir = os.path.dirname(cur)
        if next_dir == cur:
            break
        cur = next_dir
        if no_climb:
            break

def _handle_no_run_dir():
    """Handle the situation where no run directory was found."""
    if '-h' in sys.argv or '--help' in sys.argv:
        Logs.warn('No wscript file found: the help message may be incomplete')
        Context.run_dir = os.getcwd()
        ctx = Context.create_context('options')
        ctx.curdir = os.getcwd()
        ctx.parse_args()
        sys.exit(0)
    Logs.error('Waf: Run from a directory containing a file named %r' % Context.WSCRIPT_FILE)
    sys.exit(1)

def _load_wscript(file_path):
    """Load the wscript module and set up the global module."""
    try:
        set_main_module(file_path)
    except Errors.WafError as e:
        Logs.pprint('RED', e.verbose_msg)
        Logs.error(str(e))
        sys.exit(1)
    except Exception as e:
        Logs.error('Waf: The wscript in %r is unreadable' % Context.run_dir, e)
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)

def _run_commands_wrapper():
    """Run the command sequence and handle errors."""
    try:
        run_commands()
    except Errors.WafError as e:
        if Logs.verbose > 1:
            Logs.pprint('RED', e.verbose_msg)
        Logs.error(e.msg)
        sys.exit(1)
    except SystemExit:
        raise
    except Exception as e:
        traceback.print_exc(file=sys.stdout)
        sys.exit(2)
    except KeyboardInterrupt:
        Logs.pprint('RED', 'Interrupted')
        sys.exit(68)

